"      <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?39/58/40867/contributors\" id=\"se4723\">",
"       Charles J Lockwood, MD",
"      </a>",
"     </td>",
"     <td>",
"      <a class=\"contributor contributor_credentials patTopicContributorsType\" href=\"mobipreview.htm?39/58/40867/contributors\">",
"       Deputy Editor",
"      </a>",
"      <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?39/58/40867/contributors\" id=\"de1930\">",
