var title_f39_58_40875="Challenges neural blockade";
var content_f39_58_40875=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F80802&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F80802&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Anatomic, physiological, and pharmacological challenges in neural blockade for cancer pain",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Physiologic and pharmacologic issues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Local anesthetic at any given concentration can affect a variable distribution of nerve fibers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sodium channel closure by the local anesthetic is dependent upon the activity of the nerve; local anesthetics produce more effect on active nerves",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Systemic redistribution of local anesthetic following nerve blocks may result in effects that are comparable to systemic administration. Systemic doses of local anesthetic can inhibit impulses from injured nerves.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        All procedures can produce a \"placebo\" response",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Anatomic considerations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anatomic variability, particularly unreliable surface anatomical landmarks, make precise nerve localization for injection difficult",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neural soft tissue is not well demonstrated on radiographic imaging techniques like CT scan",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Autonomic, sensory and somatic components of the pain are not always separable by peripheral or central neural blockade",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The sympathetic nerves carry both efferent and afferent neural information",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Many body regions have more than one innervation; several nerves to an affected area may require injection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The local anesthetic can spread to adjacent tissues; the target tissue may not be the source of the pain, but may appear so as a result of local anesthetic spreading to the actual generator of the pain",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
