var title_f39_58_40876="Signs symptoms allergic reaction during OFC";
var content_f39_58_40876=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F77080&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F77080&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Signs and symptoms of an allergic reaction to monitor for during an oral food challenge",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Skin:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Feeling of warmth, flushing [erythema], itching [may begin on palms and soles], urticaria, angioedema, morbilliform rash, and \"hair standing on end\" [piloerection]",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Infants and children: eczematous flare",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Oral:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Itching or tingling of lips, tongue, or palate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Edema of lips, tongue, uvula, metallic taste",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Infants: drooling",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Children: rubbing tongue against pruritic palate, scratching tongue with hand",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Gastrointestinal:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nausea, abdominal pain [colic, cramps], vomiting [large amounts of \"stringy\" mucus], and diarrhea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Difficulty swallowing*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Respiratory:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Laryngeal - pruritus and \"tightness\" in the throat, dysphagia, dysphonia and hoarseness, and sensation of itching in the external auditory canals",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lung - shortness of breath, dyspnea, chest tightness, deep or repetitive cough, and wheezing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nose - itching, congestion, rhinorrhea, and sneezing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Cardiovascular:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Feeling of faintness or dizziness; syncope, chest pain, palpitations, and/or hypotension (tunnel vision, difficulty hearing)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Neurologic:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Anxiety, apprehension, sense of impending doom, seizures, confusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Infants: lethargy, hypotonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Children: abrupt cessation of activity, fetal position",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Ocular:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Periorbital itching, erythema and edema, tearing, and conjunctival erythema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Other:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lower back pain due to uterine cramping in women",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Children: ear pulling as an indication of pruritus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Vital signs/other objective measures:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pulse oximetry, respiratory rate, peak flow, pulmonary function testing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pulse, blood pressure",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Often occurs in association with throat tightness and other upper airway symptoms.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
